import React from 'react'
import {Header, Grid, Image} from 'semantic-ui-react'


class HeaderPanel extends React.Component{
    render(){

        return(

            <Grid.Column floated='left' verticalAlign='middle' textAlign='center'> 

            <Header>
                <Image circular src='https://www.gravatar.com/avatar/376ff76b1cf9cca75006978f4b993e61?d=identicon'></Image>
            </Header>

            </Grid.Column>

        );

    }

}


export default HeaderPanel;
